import React, { Component } from 'react'


class File extends Component{
    method() {
        return <h4>Homsi</h4>
    }
    render() {
        const name = 'Nour'
        const name2 = this.method()
     

        return (
            <div>  
            <h1>{name}</h1>
                <h2>{name2}</h2>
                </div>
        )
    }
}

export default File;
